import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './styles.css';
import './Heading.css'

const img = "https://images.pexels.com/photos/977962/pexels-photo-977962.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940";


function Heading() {
  return (
      <div>
      <header class="Header" >
        <img class="headerImage" src={img} alt="The Bike" />
        <h1>Welcome!</h1>

      </header>
      </div>
        );
}
export default Heading;
